void poll_spacebar(){
	volatile int * PS2_ptr = (int *)PS2_BASE;
    int PS2_data;

	bool isSpacePressed = false;
    while(!isSpacePressed) {
        PS2_data = *(PS2_ptr);
        int avail = (PS2_data & 0xFFFF0000) >> 16;

        if (avail > 0) {
            unsigned char byte = PS2_data & 0xFF;

            if (byte == 0x29) { // spacebar
                isSpacePressed = true;
            }
        }
        //usleep(1000); // Poll every 1ms
    }
}

