void wait_for_vsync(){
  volatile int* pixel_ctrl_ptr = (int*) 0xFF203020;
  register int status;
  *pixel_ctrl_ptr = 1;
  status = *(pixel_ctrl_ptr+3);
  while((status & 0x01)!=0){
    status = *(pixel_ctrl_ptr+3);
  }
}

