void draw_line(int x1, int y1, int x2, int y2, short int line_color){
  bool steep = abs(y2-y1) > abs(x2-x1);
  int yStep = 0;
  if(steep){
    int temp = x1;
    x1 = y1;
    y1 = temp;
    temp = x2;
    x2 = y2;
    y2 = temp;
  }
  if(x1>x2){
    int temp = x1;
    x1 = x2;
    x2 = temp;
    temp = y1;
    y1 = y2;
    y2 = temp;
  }

  int deltaX = x2 - x1;
  int deltaY = abs(y2 - y1);
  int error = -(deltaX/2);
  int y = y1;
  if(y1 < y2){
    yStep = 1;
  }
  else{
    yStep = -1;
  }
	int x;
  for( x = x1 ; x < x2 ; x++){
    if(steep){
      plot_pixel(y,x,line_color);
    }
    else{
      plot_pixel(x,y,line_color);
    }
    error = error + deltaY;
    if(error > 0){
      y = y + yStep;
      error = error - deltaX;
    }
  }
  
}
