/*
 * Turn off interrupts in the ARM processor
*/
void disable_A9_interrupts(void) {
	int status = 0b11010011;
	asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}
/*
 * Initialize the banked stack pointer register for IRQ mode
*/
void set_A9_IRQ_stack(void) { int stack, mode;
	stack = 0xFFFFFFFF - 7; // top of A9 onchip memory, aligned to 8 bytes /* change processor to IRQ mode with interrupts disabled */
	mode = 0b11010010;
	asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
	/* set banked stack pointer */
	asm("mov sp, %[ps]" : : [ps] "r"(stack));
	/* go back to SVC mode before executing subroutine return! */
	mode = 0b11010011;
	asm("msr cpsr, %[ps]" : : [ps] "r"(mode));
}

/*
 * Turn on interrupts in the ARM processor
*/
void enable_A9_interrupts(void) {
	int status = 0b01010011;
	asm("msr cpsr, %[ps]" : : [ps] "r"(status));
}

/*
 * Configure the Generic Interrupt Controller (GIC)
*/
void config_GIC(void) {
	config_interrupt (PS2_INTERRUPT_ID, 1); // configure the PS/2
	// Set Interrupt Priority Mask Register (ICCPMR). Enable interrupts of all // priorities
	*((int *) 0xFFFEC104) = 0xFFFF;
	// Set CPU Interface Control Register (ICCICR). Enable signaling of // interrupts
	*((int *) 0xFFFEC100) = 1;
	// Configure the Distributor Control Register (ICDDCR) to send pending // interrupts to CPUs
	*((int *) 0xFFFED000) = 1;
}

/*
 * Configure Set Enable Registers (ICDISERn) and Interrupt Processor Target
 * Registers (ICDIPTRn). The default (reset) values are used for other registers
 * in the GIC.
*/
void config_interrupt(int N, int CPU_target) {
	int reg_offset, index, value, address;
    /* Configure the Interrupt Set-Enable Registers (ICDISERn).
     * reg_offset = (integer_div(N / 32) * 4
     * value = 1 << (N mod 32) */
    reg_offset = (N >> 3) & 0xFFFFFFFC;
	index = N & 0x1F;
	value = 0x1 << index;
	address = 0xFFFED100 + reg_offset;
/* Now that we know the register address and value, set the appropriate bit */ 
	*(int *)address |= value;
	/* Configure the Interrupt Processor Targets Register (ICDIPTRn)
		 * reg_offset = integer_div(N / 4) * 4
		 * index = N mod 4 */
	reg_offset = (N & 0xFFFFFFFC);
	index = N & 0x3;
	address = 0xFFFED800 + reg_offset + index;
	/* Now that we know the register address and value, write to (only) the
		 * appropriate byte */
	*(char *)address = (char)CPU_target; 
}


/********************************************************************
* Pushbutton - Interrupt Service Routine
*
* This routine checks which KEY has been pressed. It writes to HEX0
*******************************************************************/
void pushbutton_ISR(void) {
	/* KEY base address */
	volatile int * KEY_ptr = (int *) 0xFF200050;
	/* HEX display base address */
	volatile int * HEX3_HEX0_ptr = (int *) 0xFF200020; 
	int press, HEX_bits;
	press = *(KEY_ptr + 3);
	 *(KEY_ptr + 3) = press;
	if (press & 0x1)
		HEX_bits = 0b00111111;
	else if (press & 0x2)
		HEX_bits = 0b00000110;
	else if (press & 0x4)
		HEX_bits = 0b01011011;
	else
			HEX_bits   = 0b01001111;
	*HEX3_HEX0_ptr = HEX_bits;
	return; 
}


/* setup the PS/2 interrupts in the FPGA */
void config_PS2() {
    volatile int * PS2_ptr = (int *)PS2_BASE; // PS/2 port base address
    *(PS2_ptr) = 0xFF; // reset
    *(PS2_ptr + 1) = 1; // enable interrupts for the PS/2 port
}

void PS2_ISR(void) {
    volatile int * PS2_ptr = (int *)PS2_BASE;
    int PS2_data = *(PS2_ptr);
    int available = (PS2_data & 0xFFFF0000) >> 16;

    if (available > 0) {
        unsigned char byte = PS2_data & 0xFF;

        if (byte == 0x75) { // up arrow
            move_cursor(0, -1);
        } else if (byte == 0x72) { // down arrow
            move_cursor(0, 1);
        } else if (byte == 0x6B) { // left arrow
            move_cursor(-1, 0);
        } else if (byte == 0x74) { // right arrow
            move_cursor(1, 0);
        } else if (byte == 0x5A) { // enter key
            select_and_move_piece();
			drawValid();
        }
    }
}

