//checks if the piece selected is eligible to jump multiple pieces
//recursive function that follows the pattern of the movement, checks all posibilities and sets the positions that the piece can be moved to to 1
//in an array called possible_moves
void checkForDoubleJump(int x, int y, int type){
	//general algorithm:
	//check right daig
	//check left diag
	//at the point where u cant find the next 0
	//add the final pos meaning the x and y into the vector
	//thats another position u mark
	//clear_screen();
	
	//if its player 1's turn, then initially we just need to check the upwards two diagonals, and make recursive calls
	if(currentPlayer == 1){
		
		if(y-2 >= 0 && x-2 >= 0){//checks if we will be checking indexes within bounds
			//checks if the piece immediately across is an opp piece (which can be normal or a king) and if the one after the opp piece
			//is a zero, this tells us that the piece has space to jump and settle into
			//it also checks to make sure that this space hasn't been visited already to make sure that we are not stuck in an infinite loop
			if((current_board[y-1][x-1] == 2 || current_board[y-1][x-1] == 4) && current_board[y-2][x-2] == 0 && possible_moves[x-2][y-2] != 1){
				possible_moves[x-2][y-2] += 1;
				checkForDoubleJump(x-2, y-2, type);//performs recursive call to see if we can keep jumping
			}
		}
		
		if(y-2 >= 0 && x+2 < 8){//up right
			if((current_board[y-1][x+1] == 2 || current_board[y-1][x+1] == 4) && current_board[y-2][x+2] == 0 && possible_moves[x+2][y-2] != 1){
				possible_moves[x+2][y-2] += 1;
				checkForDoubleJump(x+2, y-2, type);
			}
		}
		
		if(type == 3){//if piece is also a king, we have to check in the bottom direction too
			
			if(y+2 < 8 && x-2 >= 0){//down left
				if((current_board[y+1][x-1] == 2 || current_board[y+1][x-1] == 4) && current_board[y+2][x-2] == 0 && possible_moves[x-2][y+2] != 1){
					possible_moves[y+2][x-2] += 1;
					checkForDoubleJump(x-2, y+2, type);
				}
			}
			
			if(y+2 < 8 && x+2 < 8){//down right
				if((current_board[y+1][x+1] == 2 || current_board[y+1][x+1] == 4) && current_board[y+2][x+2] == 0 && possible_moves[x+2][y+2] != 1){
					possible_moves[x+2][y+2] += 1;
					checkForDoubleJump(x+2, y+2, type);
				}
			}
			
		}
		
		//if there are no more positions left to check, that means that we have no more jumps to make and so we can end the recursion
		else{
			return;
		}
		
	}
	
	else if(currentPlayer == 2){
		
		if(y+2 < 8 && x-2 >= 0){//down left
			if((current_board[y+1][x-1] == 1 || current_board[y+1][x-1] == 3) && current_board[y+2][x-2] == 0 && possible_moves[x-2][y+2] != 1){
				possible_moves[x-2][y+2] += 1;
				checkForDoubleJump(x-2, y+2, type);
			}
		}
		
		if(y+2 < 8 && x+2 < 8){//down right
			if((current_board[y+1][x+1] == 1 || current_board[y+1][x+1] == 3) && current_board[y+2][x+2] == 0 && possible_moves[x+2][y+2] != 1){
				possible_moves[x+2][y+2] += 1;
				checkForDoubleJump(x+2, y+2, type);
			}
		}
		
		if(type == 4){//white king
			
			if(y-2 >= 0 && x-2 >= 0){//up left
				if((current_board[y-1][x-1] == 1 || current_board[y-1][x-1] == 3) && current_board[y-2][x-2] == 0 && possible_moves[x-2][y-2] != 1){
					possible_moves[x-2][y-2] += 1;
					checkForDoubleJump(x-2, y-2, type);
				}
			}
			
			if(y-2 >= 0 && x+2 < 8){//up right
				if((current_board[y-1][x+1] == 1  || current_board[y-1][x+1] == 3) && current_board[y-2][x+2] == 0 && possible_moves[x+2][y-2] != 1){
					possible_moves[x+2][y-2] += 1;
					checkForDoubleJump(x+2, y-2, type);
				}
			}
			
		}
		
		else{
			return;
		}
		
	}
}

//After a move is selected, this function is called to remove the pieces off the board,
//or in other words, take/kill the pieces that the selected piece jumps over.
//Recursive function that takes in the starting point, the destination and the type of piece (1,2,3,4)
//This then looks at all the possibilities till the piece reaches the final destination
//once it is verified which path is the right path, it comes back and deletes all the opp pieces
//that were in the way.
//that is what it returns an int for, to tell us if the path selected was correct or not
int makeTakes(int sel_x, int sel_y, int curr_x, int curr_y, int type){
	
	//if it is player 1's turn
	if(currentPlayer == 1){
		//this is the condition that indicates that the recursion is complete
		//or that the correct path has been found
		//this returns 1 once we have reached the final destination
		if(sel_x == curr_x && sel_y == curr_y){
			return 1;
		}
		
		//Checks bounds
		//checks that the one across is opp
		//checks that the one after opp is an empty space for the piece to jump to
		//also checks that the position hasnt been accessed before to delete piece, this prevents infinite looping between two positions
		//makes a recursive call inside the if statement, we will only delete a piece after we have established that going across this will lead us to the final dest
		if(sel_y-2 >= 0 && sel_x-2 >= 0){
			if((current_board[sel_y-1][sel_x-1] == 2 || current_board[sel_y-1][sel_x-1] == 4) && current_board[sel_y-2][sel_x-2] == 0){
				possible_moves[sel_x-2][sel_y-2]++;
				if(possible_moves[sel_x-2][sel_y-2] <= 2 && makeTakes(sel_x-2, sel_y-2, curr_x, curr_y, type) == 1){
					current_board[sel_y-1][sel_x-1] = 0;
					pOneKills++;
					return 1;
				}
			}
		}
		
		if(sel_y-2 >= 0 && sel_x+2 < 8){
			if((current_board[sel_y-1][sel_x+1] == 2 || current_board[sel_y-1][sel_x+1] == 4) && current_board[sel_y-2][sel_x+2] == 0){
				if(possible_moves[sel_x+2][sel_y-2] <= 2 && makeTakes(sel_x+2, sel_y-2, curr_x, curr_y, type) == 1){
					current_board[sel_y-1][sel_x+1] = 0;
					pOneKills++;
					return 1;
				}
			}
		}
		
		//if it is of type three, we have to perform the same in the opp direction
		if(type == 3){
			
			if(sel_x-2 >= 0 && sel_y+2 < 8){
				if((current_board[sel_y+1][sel_x-1] == 2 || current_board[sel_y+1][sel_x-1] == 4) && current_board[sel_y+2][sel_x-2] == 0){
					if(possible_moves[sel_x-2][sel_y+2] <= 2 && makeTakes(sel_x-2, sel_y+2, curr_x, curr_y, type) == 1){
						current_board[sel_y+1][sel_x-1] = 0;
						pOneKills++;
						return 1;
					}
				}
			}
			
			if(sel_x+2 < 8 && sel_y+2 < 8){
				if((current_board[sel_y+1][sel_x+1] == 2 || current_board[sel_y+1][sel_x+1] == 4) && current_board[sel_y+2][sel_x+2] == 0){
					if(possible_moves[sel_x+2][sel_y+2] <= 2 && makeTakes(sel_x+2, sel_y+2, curr_x, curr_y, type) == 1){
						current_board[sel_y+1][sel_x+1] = 0;
						pOneKills++;
						return 1;
					}
				}
			}
			
		}
	}
	
	//same but on player 2's turn
	if(currentPlayer == 2){
		
		if(sel_x == curr_x && sel_y == curr_y){
			return 1;
		}
		
		if(sel_x-2 >= 0 && sel_y+2 < 8){
			if((current_board[sel_y+1][sel_x-1] == 1  || current_board[sel_y+1][sel_x-1] == 3) && current_board[sel_y+2][sel_x-2] == 0){
				if(possible_moves[sel_x-2][sel_y+2] <= 2 && makeTakes(sel_x-2, sel_y+2, curr_x, curr_y, type) == 1){
					current_board[sel_y+1][sel_x-1] = 0;
					pTwoKills++;
					return 1;
				}
			}
		}
		
		if(sel_x+2 < 8 && sel_y+2 < 8){
			if((current_board[sel_y+1][sel_x+1] == 1 || current_board[sel_y+1][sel_x+1] == 3) && current_board[sel_y+2][sel_x+2] == 0){
				if(possible_moves[sel_x+2][sel_y+2] <= 2 && makeTakes(sel_x+2, sel_y+2, curr_x, curr_y, type) == 1){
					current_board[sel_y+1][sel_x+1] = 0;
					pTwoKills++;
					return 1;
				}
			}
		}
		
		if(type == 4){
			
			if(sel_y-2 >= 0 && sel_x-2 >= 0){
				if((current_board[sel_y-1][sel_x-1] == 1 || current_board[sel_y-1][sel_x-1] == 3) && current_board[sel_y-2][sel_x-2] == 0){
					if(possible_moves[sel_x-2][sel_y-2] <= 2 && makeTakes(sel_x-2, sel_y-2, curr_x, curr_y, type) == 1){
						current_board[sel_y-1][sel_x-1] = 0;
						pTwoKills++;
						return 1;
					}
				}
			}
			
			if(sel_y-2 >= 0 && sel_x+2 < 8){
				if((current_board[sel_y-1][sel_x+1] == 1 || current_board[sel_y-1][sel_x+1] == 3) && current_board[sel_y-2][sel_x+2] == 0){
					if(possible_moves[sel_x+2][sel_y-2] <= 2 && makeTakes(sel_x+2, sel_y-2, curr_x, curr_y, type) == 1){
						current_board[sel_y-1][sel_x+1] = 0;
						pTwoKills++;
						return 1;
					}
				}
			}
			
		}
		
	}
	
	return 0;
}

//removes all found possibilities to make space for a new ones and remove markings from board
void unDrawPossibleMoves(){
	int i,j;
	for(i  = 0 ; i < 8 ; i++){
		for(j = 0 ; j < 8 ; j++){
			if(possible_moves[i][j] == 1){
				possible_moves[i][j] = 0;
				draw_box_outline((i)*30, (j)*30, GREY);
			}
		}
	}
}


	